webpackJsonp([0xf9e7bfb84156],{348:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Bondor",author:"Stephen Bondor"}},markdownRemark:{id:"/Users/bondor/Desktop/Lambda/Projects/blog/src/pages/2019-2-21-labs-week-one/index.md absPath of file >>> MarkdownRemark",html:'<h2>Part 1 - Individual Accomplishments this Week</h2>\n<h4>Your team’s github contribution graph and your Github:</h4>\n<p><a href="https://github.com/StephenBondor">StephenBondor</a>\n— <a href="https://github.com/Lambda-School-Labs/labs-team-home/graphs/contributors">Team Contribution Graph</a></p>\n<h4>This week</h4>\n<p>This week we began the process of refactoring and then adding to the code base we inherited from the previous labs team. Our new deploy is <a href="https://team-home-2.netlify.com/">here</a>.</p>\n<h4>Tasks Pulled</h4>\n<blockquote>\n<blockquote>\n<p>List the tasks you pulled this week, and provide a link to the successfully merged PR completing that task and the trello card for that task. You must have at least one front end and one back end. The expected total is 6 with a minimum of 4.</p>\n</blockquote>\n</blockquote>\n<p><strong>Ticket 1</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/278">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 2</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/279">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 3</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/280">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 4</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/284">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 5</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/290">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 6</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/292">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 7</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/295">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 8</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/302">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 9</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/307">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 10</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/309">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 11</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/314">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a></p>\n<h4>Detailed Analysis</h4>\n<blockquote>\n<blockquote>\n<p>Pick one of your tickets and provide a detailed analysis of the work you did. This should be approximately ¼ page of text, and at least three screenshots.</p>\n</blockquote>\n</blockquote>\n<h5>Code Deprecation, Refactoring, and Standardizing</h5>\n<p>So, this is not going to be pretty. Instead of choosing one pull request, I will be referring to many of the early pull requests this week that comprise many different issues which I hope to shed light on, that all flow from the topic of refactoring inherited code.</p>\n<p>But first, a few caveats.</p>\n<p>This code works. <strong>Full stop.</strong> It’s not without its bugs, just like any other code, but it <em>works</em>. So, before we jump into the refactoring, this context needs to be in place. On top of that, their are extra-curricular circumstances I do not know, but, given the circumstances of Lambda Labs—circumstances that my team and I have seen thus far ourselves—we must assume that this pervious code was written under stress, with little time, and suffering from all communication issues inherent in all computer or internet based channels. To be clear, the fact that this code was shipped, in an of itself, is awesome. And for real, I make no claims that my code is not without bugs or any better, in fact, I expect that my code can be radically refactored to 1/10th the size. All I claim is that this refactoring is better consumable by my team give our context.</p>\n<hr>\n<h4>So lets dive in…</h4>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 170.28985507246378%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Specimen #1"\n        title=""\n        src="/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-6572b.png 175w,\n/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-e3b29.png 700w,\n/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-1eceb.png 1050w,\n/static/Screen_Shot_2019-02-15_at_2.00.15_PM-2e3496dc7be1c9a0673cec86e0ed07a6-605e9.png 1380w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Specimen #1</em></p>\n<p>This is one of two nearly identical components found in two files. Each renders according to if the user is the creator, or owner, of the content. As you can see, there are two eerily similar components rendered conditionally. Considering that together these components represent 120 lines of code, it seemed to me to be an easy win for the development teams code-consumption time to refactor this code into ~40 lines:</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 119.30501930501931%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Refactor of Specimen #1"\n        title=""\n        src="/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-6572b.png 175w,\n/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-e3b29.png 700w,\n/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-1eceb.png 1050w,\n/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-f5de9.png 1400w,\n/static/Screen_Shot_2019-02-21_at_10.09.12_PM-67d1a862b1937b1a9eb7276da481296b-014d0.png 1554w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Refactor of Specimen #1</em></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 29.5169946332737%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Specimen #2"\n        title=""\n        src="/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-6572b.png 175w,\n/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-e3b29.png 700w,\n/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-1eceb.png 1050w,\n/static/Screen_Shot_2019-02-18_at_6.20.19_PM-1876a71e102d4fb39a12b6d86cbaedfe-7b034.png 1118w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Specimen #2</em></p>\n<p>Specimen #2 is rather interesting. As the famous Ashwin Sundararajan puts it:</p>\n<blockquote>\n<p>Arrow functions were introduced to javascript because basically most of the other languages had lambda functions and JS didn’t. Though they were primarily intended to make FP easier, there was this weird request from the community to somehow have a lexical binding for <code class="language-text">this</code> (again this is a feature for other OOP languages) and ECMA thought it would be a good idea to combine both of the needs. All in a day’s work.</p>\n</blockquote>\n<p>Effectively, this code can be refactored by using a JS arrow function. Though it only saves one line of code, it can saves on developer comprehension time as <code class="language-text">.bind()</code> is hard to comprehend, rarely used, and this code is only a state change to begin with.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 17.741935483870964%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Refactor of Specimen #2"\n        title=""\n        src="/static/Screen_Shot_2019-02-21_at-10.07.03_PM-223d79bba6b035c29e2fbe272608cc0f-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-21_at-10.07.03_PM-223d79bba6b035c29e2fbe272608cc0f-6572b.png 175w,\n/static/Screen_Shot_2019-02-21_at-10.07.03_PM-223d79bba6b035c29e2fbe272608cc0f-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-21_at-10.07.03_PM-223d79bba6b035c29e2fbe272608cc0f-e3b29.png 700w,\n/static/Screen_Shot_2019-02-21_at-10.07.03_PM-223d79bba6b035c29e2fbe272608cc0f-25203.png 868w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Refactor of Specimen #2</em></p>\n<p>These small fixes can really add up after, say, refactoring a 580 line component with 700+ changes. Um, which is one thing that happened while refactoring…</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 11.181434599156118%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAACCAYAAABYBvyLAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAdklEQVQI1x2KyxaDMAgF/f+f66LbHm01D+MjRMDo7haz4AwD09V6gUSQcsC57dBawSw4bES1ke1fytH2TKWRjE9H7c4QUVz3jU60whPh3b+QP1+sheF8hI8Jad0R5wUuzAjmowvoh7H5ZM3jw2+ydsayZbCe+AMP5JazY5SIMgAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Refactor The Mother"\n        title=""\n        src="/static/Screen_Shot_2019-02-22_at_8.48.05_AM-610305dafd00766e65b623916f76a3a3-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-22_at_8.48.05_AM-610305dafd00766e65b623916f76a3a3-6572b.png 175w,\n/static/Screen_Shot_2019-02-22_at_8.48.05_AM-610305dafd00766e65b623916f76a3a3-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-22_at_8.48.05_AM-610305dafd00766e65b623916f76a3a3-e3b29.png 700w,\n/static/Screen_Shot_2019-02-22_at_8.48.05_AM-610305dafd00766e65b623916f76a3a3-81108.png 948w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>The mother of all component refactoring</em></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.68141592920353%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Specimen #3"\n        title=""\n        src="/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-e3b29.png"\n        srcset="/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-6572b.png 175w,\n/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-e1ddf.png 350w,\n/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-e3b29.png 700w,\n/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-1eceb.png 1050w,\n/static/Screen_Shot_2019-02-20_at_8.44.37_PM-03212dc7d7c61e4eb3148884e4ac68ca-94b92.png 1130w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Specimen #3</em></p>\n<p>To be honest, this one took me a long time to figure out. When I first approached this component I knew that this particular section was a bit over my head. But, the component was 580 lines long, so their was a good chance that I was not at the level needed to fully get it anyway. However, as I parsed and deconstructed the component, I found that there was only one other place this functionality could interact with, this line:</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 536px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 8.582089552238806%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAACCAYAAABYBvyLAAAACXBIWXMAABYlAAAWJQFJUiTwAAAAi0lEQVQI1yXMzwqCMADAYR+l2JQFSWL749xKZ2FEFHTr1LFj4Av06r+kTt/ty2wUaC+o3WwrME7SKMVBC0K9xFYSbSqGFAjR4nTJM2143zteZ4dZF2wLSV1WRDuSmTl0+3/WHiU+5oRiRV9LerOgdwrXaE5jTxoiaWeZbp7PY2C6WkKpsHn+Czt/4QtmfEIUWiLurgAAAABJRU5ErkJggg==\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Specimen #3b"\n        title=""\n        src="/static/Screen_Shot_2019-02-20_at_8.44.48_PM-70be4a38c884e4efaec9ee3120f746a2-b8569.png"\n        srcset="/static/Screen_Shot_2019-02-20_at_8.44.48_PM-70be4a38c884e4efaec9ee3120f746a2-196f3.png 175w,\n/static/Screen_Shot_2019-02-20_at_8.44.48_PM-70be4a38c884e4efaec9ee3120f746a2-13500.png 350w,\n/static/Screen_Shot_2019-02-20_at_8.44.48_PM-70be4a38c884e4efaec9ee3120f746a2-b8569.png 536w"\n        sizes="(max-width: 536px) 100vw, 536px"\n      />\n    </span>\n  </span>\n  <em>Specimen #3b</em></p>\n<p>In effect, those 6 lines of code at the top are a JS and @materialUI solution to a inline CSS @media-query, which says: <em>when the window width is below a certain level, make the component full screen.</em></p>\n<hr>\n<h2>Part 2</h2>\n<p>This weeks prompt should be divided into its appropriate sections:</p>\n<blockquote>\n<blockquote>\n<p>As a part of your journal entry, write ¼ to ½ a page reflecting on your experiences forming a team. What did you do to help the team solidify as a group?</p>\n</blockquote>\n</blockquote>\n<p>We have all worked together before, so answering this question really comes down to how we picked the group. And to that end, two of our members volunteered, and I reached out to the other 3 to bring them into the fold. In terms of making sure our group has been solidifying, I help make sure that all members are coordinated, and that no member is working on the exact same task, unless that task is particularly difficult.</p>\n<blockquote>\n<blockquote>\n<p>What did you do that you now realize caused friction in this process?</p>\n</blockquote>\n</blockquote>\n<p>Letting people decide their rolls instead of assigning them and asking for feedback or other suggestions.</p>\n<blockquote>\n<blockquote>\n<p>What are you doing personally to make sure that everyone on the team, including you, has a voice in decision making?</p>\n</blockquote>\n</blockquote>\n<p>First, generally, for someone to contribute, they need the right information set. They must have continual access to communication channels. Letting a teams communication break down will kill this goal and being strictly online, communication is naturally hindered. What is more, the nature of Labs naturally divides many of the groups. This dramatically reduces the knowledge base and magnifies problems. So, I try to get out of the way as much as possible, and put aside differences to get people in front of each other as much as I can. Specifically, when this is in place, I’ll calling people out by name, tactfully, and asking for their opinion on a topic.</p>\n<blockquote>\n<blockquote>\n<p>As a group, provide links to evidence that:\nFront and back end servers are connected</p>\n</blockquote>\n</blockquote>\n<p><a href="https://team-home-2.netlify.com/">Front End</a>\n<a href="https://team-home-2-graphql-mongodb.herokuapp.com/graphql">Back End</a></p>\n<blockquote>\n<blockquote>\n<p>Users can create accounts and log in through the front end via OAuth</p>\n</blockquote>\n</blockquote>\n<p><a href="https://team-home-2.netlify.com/">Deploy</a></p>\n<blockquote>\n<blockquote>\n<p>All APIs and services are connected and can be interacted with through the front end. A test message is acceptable to meet this requirement</p>\n</blockquote>\n</blockquote>\n<p>See above.</p>',excerpt:"Part 1 - Individual Accomplishments this Week Your team’s github contribution graph and your Github: StephenBondor \n—  Team Contribution Graph This week This week we began the process of refactoring and then adding to the code base we inherited from the previous labs team. Our new deploy is  here . Tasks Pulled List…",frontmatter:{title:"Labs Week Two",date:"21st February 2019",path:"/labs-week-two"}}},pathContext:{}}}});
//# sourceMappingURL=path---labs-week-two-aed64927da4cb5593141.js.map